var replace_imgs = function () {
    for(i = 0; i < repl.length; i++) {
        var obj = repl[i];
        $('img[src="' + obj[0] + '"]').each(function(index){
            $(this).attr('src', obj[1]);
            var _this = this;
            Debug(function () { $(_this).after(index); });
        });
    }
}

